class DeobNoopLDR_Plugin(idaapi.plugin_t):
    flags = idaapi.PLUGIN_DRAW
    comment = "Deobfuscate win32api on CFF"
    help = ""
    wanted_name = "DeobNoopLDR"
    wanted_hotkey = "" # = "Alt-F10"

    def init(self):
        return idaapi.PLUGIN_KEEP

    def run(self, arg):
        main()
        return

    def term(self):
        pass


def PLUGIN_ENTRY():
    return DeobNoopLDR_Plugin()



